import React from "react";
import logoBarra from '../Img/gato-normal.jpg';
import { Outlet, Link } from "react-router-dom";

import '../Css/Boton-Nav.css';


function BarraNav(){
  return(
    <div className = 'contenedor'>
      <nav>
        <img
          className = 'imagenBarra'
          src = {logoBarra}
          alt = 'Logo barra nav' />
        <Link
          className='BotonCambioPag'
          to= "/">Inicio
        </Link>
        <Link
          className='BotonCambioPag'
          to="../Pages/SobreMi.jsx">Sobre Mi
        </Link>
        <Link
          className='BotonCambioPag'
          to="../Pages/Contacto.jsx">Contacto
        </Link>
        <Link
          className='BotonCambioPag'
          to="/" >Ejemplo 4
        </Link>
        <Link
          className='BotonCambioPag'
          to="/" >Ejemplo 5
        </Link>
      </nav>
      <Outlet />
    </div>
  );
};

export default BarraNav;
